import React from "react";
import ingredienCard from './IngredientCard.module.css';

const IngredientCard = (props) => {
    return (
        <div className={ingredienCard.card}>
            <img src={props.image[0]} alt='x'/>
            <p className="text text_type_main-small">{props.name[0]}</p>
            <p className="text text_type_main-small">{props.price[0]}</p>
        </div>
    )
}

export default IngredientCard;
